import "./ListRow.css";

const ListRow = () => {
  return (
    <div className="list-row3">
      <div className="submit17">
        <b className="b225">제출 완료</b>
      </div>
      <div className="div285">
        <span>
          <p className="p185">3주차 과제</p>
          <p className="p186">2</p>
          <p className="p187">3</p>
        </span>
      </div>
      <div className="div286">3 주차</div>
      <div className="div287">24-03-24 23:59</div>
      <div className="div288">-</div>
    </div>
  );
};

export default ListRow;
